(6044, 3551, '20123344228', '1233442', 'NICOLÁS', NULL, 'masculino', 'CATALDI ', 'DUMESNIL', 1207, '', '', 'PROVIDENCIA', '3513846999', '1958-03-03', 62, 'floria58', 'Ingecat777', '', 'No', NULL, '', 'CORDOBA', NULL, 'Otra', 'ESPERANDO REGULARIDAD.', NULL, 'Argentina', 'administrativo', NULL, NULL, NULL, 'cf: Ingecat777 - css: floria58 - proc: Consulta web - PASA SOCIO 23/08  - CUANDO PIDAMOS FORMULARIOS AVISAR QUE PASA SOCIO  MAIL: nicolascataldi45@gmail.com // en oportunidad de jubilarse ver si conviene o no llevar 10 años de aportes de Caja de Ingenieros y jubilar por Convenio de Reciprocidad (dependera de haber minimo caja privada y haber anses)', NULL, NULL, NULL, NULL, NULL, '--', '12/08/2020 mande mail con calculo bluecorp y explicando duda: \r\n\"En principio, estimamos lo más prudente será postergar la decisión respecto a la conveniencia o no de hacer uso de dichos servicios (en virtud del Convenio de reciprocidad vigente) para la oportunidad del cumplimiento de sus 65 años, ya que dependerá sobre todo del haber mínimo vigente en dicho entonces en la Caja de Ingenieros, y también de la actualización de los valores correspondientes al beneficio jubilatorio suyo de acuerdo a baremos futuros (hoy desconocidos) de la Administración Nacional de la Seguridad Social.\r\nEn consecuencia, si le parece dejamos pendiente dicha respuesta para ese momento; y ya lo dejamos asentado en su legajo y debidamente agendado.  \r\nA su disposición por cualquier consulta, aprovechamos para saludarlo atentamente.\"', NULL, ''),
