(7007, 3750, '27142916822', '1429168', 'MARTA ELENA', NULL, 'Femenino', 'CUEVAS', '', 0, '', '', '', '354-1394380', '1960-07-08', 60, 'estudio02', 'Estudio2019', '', 'No', NULL, '', 'CARLOS PAZ', NULL, 'Otra', 'AV ANSES - INGRESADO.', NULL, 'Argentina', 'administrativo', NULL, NULL, NULL, 'PARA NUEVA MORATORIA CON SDM - EX S/C - PUEDE INICIARSE A PARTIR DEL 08/07/2020 /// INICIE POR ATENCION VIRTUAL DE ANSES 15/07/2020 CONFORME LIQUIDACIÓN SICAM DE MISMA FECHA. Cuando nos contesten AV deberemos presentar pruebas y formularios de SDM. ', '2020-05-07', '2 haberes', NULL, NULL, NULL, '--', 'ATENCION VIRTUAL 15/07/2020/// Solicito el inicio de expediente jubilatorio conforme Ley N° 26970. Autorizo expresamente a que efectúen la evaluación patrimonial y socioeconómica prevista en la normativa. Cuento con aportes como trabajadora de casas particulares con un solo empleador (+ de 16 horas semanales) en el período 01/06/2013 al 31/05/2017 y 01/07/2017 hasta 30/06/2020. Cuento con pruebas que avalan la veracidad de dicha relación laboral. \r\nDebería regularizar a través de Moratoria Ley N° 26970 el período 08/1978 a 07/2001 para llegar a regularidad prevista por Ley, en un todo de acuerdo a liquidación SICAM N° 3 de fecha 15/07/2020. Solicito aplicación principio de insignificancia o bagatela por períodos con deuda de interés. \r\nSolicito la designación de Banco Supervielle (Sucursal Catedral - Ciudad de Córdoba - Cód. 027423) a los fines del cobro de los haberes. ///', NULL, ''),
