(7556, 3955, '27141005575', '1410055', 'PATRICIA CLAUDIA', NULL, 'Femenino', 'TERRINI', 'PJE BERNARDO ITURRIAGA', 2511, '', '', '', '3515337361', '1960-05-13', 60, 'Estudio02', 'Terrini2019', '', 'No', NULL, '', '', 'JUBILACION C/NUEVA MORATORIA (LEY 26.970)', 'Otra', 'AV ANSES - INGRESADO.', NULL, 'Argentina', 'administrativo', NULL, NULL, NULL, 'PROC: INES LOPEZ. PASA SOCIO 06/08/2020 / Inicie por Atención Virtual 13/08/2020 conforme SICAM de misma fecha - en ppio ibamos a usar 24476 pero necesitamos usar 26970 porque muchos de los periodos de historia laboral tienen remuneración $0 - texto de inicio AV en \"comunicaciones\"', '2020-08-12', NULL, NULL, NULL, NULL, '--', 'Solicito el inicio de expediente jubilatorio conforme Ley N° 26970. Autorizo expresamente a que efectúen la evaluación patrimonial y socioeconómica prevista en la normativa, solicitando se me informe el motivo en caso de rechazo. Cuento con aportes en relación de dependencia períodos 09/1991 a 12/1991 (Kirichian) y 07/2004 a 06/2007 (Hernandez Alicia). Asimismo, percibí subsidio por Desempleo período 06/1993 a 09/1993, y cuento con numerosos pagos efectuados bajo el régimen de Monotributo (período 09/2008 a 10/2016), por lo que debería regularizar a través de Moratoria Ley N° 26970 períodos que figuran en Liquidación SICAM N° 3 de fecha 13/08/2020, efectuada al solo efecto indicativo. Solicito aplicación de principio de insignificancia o bagatela por períodos con deuda de interés (12/2015 y 08/2016).Solicito la designación de Banco Supervielle (Sucursal Catedral - Ciudad de Córdoba - Cód. 027423) a los fines del cobro de los haberes. ', NULL, 'fecha | concepto | debe | haber | saldo |'),
